import React from 'react'
import {useHistory} from 'react-router-dom'
//import GoogleLogin from 'react-google-login'
import {Form} from 'react-bootstrap'
import Image from 'react-bootstrap/Image'
import Button from 'react-bootstrap/Button'


export default function Login() {

     let history=useHistory();
     const google=()=>{
         alert("Working on it");
     }


    return (
        <div  className="login-main" style={{display:'flex' , position:'absolute',Top:'0',Botton:'0'}} >
        <div className="text-center" >

            <Image src=
            "data:image/jpeg;base64," className="img-fluid" alt="" />
            <Form> 
                <div className="content" style={{display:'flex' , flexDirection:'column',marginTop:"25px"}}>

                    <h1>SIGN INTO WHATSAPP</h1>

                        <Button  variant="primary" size="lg" block style={{marginBottom:"25px", marginTop:"25px"}} onClick={google}>
                        Sign in with Google
                        </Button>
                         <Button onClick={()=>{history.push("/Sidebar");}} variant="secondary" size="lg" block> 
                         Anonymous Login
                         </Button>

                </div>


           </Form>


        </div>
        </div>

    );
}
